 Business Task\n","\n","Analyze smart device usage data of one Bellabeat product in order to gain insight into how consumers use non-Bellabeat smart devices and to unlock new opportunities for growth.\n","\n","### Prepare Data\n","\n","The data in this analysis is a publicly available data from the Fitbit Fitness Tracker Data set found at <https:www.kaggle.com/arashnic/fitbit>\n","\n","\n","## Step 1: Import your data\n"]},{"cell_type":"code","execution_count":1,"id":"56eedf13","metadata":{"execution":{"iopub.execute_input":"2022-07-21T17:46:19.038476Z","iopub.status.busy":"2022-07-21T17:46:19.035428Z","iopub.status.idle":"2022-07-21T17:46:19.272201Z","shell.execute_reply":"2022-07-21T17:46:19.270437Z"},"papermill":{"duration":0.309867,"end_time":"2022-07-21T17:46:19.272379","exception":false,"start_time":"2022-07-21T17:46:18.962512","status":"completed"},"tags":[]},"outputs":[],"source":["activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\n","calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv\")\n","sleep <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")\n","steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailySteps_merged.csv\")\n","intensity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv\")"]},{"cell_type":"markdown","id":"4f3870c4","metadata":{"papermill":{"duration":0.069529,"end_time":"2022-07-21T17:46:19.411467","exception":false,"start_time":"2022-07-21T17:46:19.341938","status":"completed"},"tags":[]},"source":["## Lets View our Dataset"]},{"cell_type":"code","execution_count":2,"id":"df228515","metadata":{"execution":{"iopub.execute_input":"2022-07-21T17:46:19.595816Z","iopub.status.busy":"2022-07-21T17:46:19.553502Z","iopub.status.idle":"2022-07-21T17:46:19.693946Z","shell.execute_reply":"2022-07-21T17:46:19.692314Z"},"papermill":{"duration":0.213602,"end_time":"2022-07-21T17:4