9188,"end_time":"2022-07-21T17:46:30.207729","exception":false,"start_time":"2022-07-21T17:46:30.058541","status":"completed"},"tags":[]},"source":["## CONCLUSIONS\n","\n","This data gave us great insights on how these smart devices are being used and how helpful they can be. From my analysis it can be deduced that:\n","\n","* There exist a Positive Correlation between number of steps and calories burned.\n","* No correlation between number of steps and sleep time.\n","* There exist a strong positive correlation between minutes asleep and time spent in bed.\n","* The average daily steps is approximately 7638 steps.\n","* Then average minutes asleep is about 7 hours.\n","\n","## RECOMMENDATIONS\n","\n","* Bellabeat Spring can alert the user after every 2000 steps to drink water through Bellabeat App. This also acts as a notification to be more active.\n","* Bellabeat App can notify users about sleep time. It should be able to be preprogrammed for a specific sleep time.\n","\n","# Thanks to Google and Cousera for contribution to Data analytics learning community. \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":15.096686,"end_time":"2022-07-21T17:46:30.465436","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-07-21T17:46:15.36875","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}